import React from 'react';
import { useState } from 'react'
import './login.css';
import videoSource from '../assets/background-video.mp4'

function LoginPage(props) {
  const [username, getUsername] = useState("");
  const [password, getPassword] = useState("");

  function handleLogin()
  {
    if(username === "admin")
        props.setStatus(true)
    }

  return (
    <>
    <div className='firstlayer-one'></div>
     <video autoPlay muted loop id="myVideo">
        <source src={videoSource} type="video/mp4" />
    </video>
    <div className='login-page'>
    <div className="login-container">
      <form className="login-form">
        <h1 className="login-title">Login</h1>

        <label htmlFor="username" className="login-label">Username</label>
        <input type="text" value={username} id="username" placeholder="Enter your username" className="login-input" required />

        <label htmlFor="password" className="login-label">Password</label>
        <input type="password" value={password} id="password" placeholder="Enter your password" className="login-input" required />

        <button type="submit" className="login-button">Log In</button>
      </form>
    </div>
    </div>
    </>
  );
}

export default LoginPage;
